import React from "react"

import BalancePanel from "./containers/BalancePanel"
import TransactionsPanel from './containers/TransactionPanel'
import AccountsPanel from './containers/AccountsPanel'


const Dash = () => {
  return (
    <div>
      <BalancePanel/>
      <TransactionsPanel /> 
      <AccountsPanel /> 
    </div>
  )

}

export default Dash;
